MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "Use the Command Center application of SimcenterFlotherm software to perform  what if  scenarios on a base project and optimize your design.");
MGCAddSnippet(5, "Use the command center to create and solve different scenarios for a Simcenter Flotherm project, compare results and optimize the project.");
MGCAddSnippet(6, "The Command Center application can be opened from any Simcenter Flotherm application window.");
MGCAddSnippet(7, "Use this procedure to reset the Command Center to its default settings. All input variables, output variables, scenarios, and scenario results are removed.");
MGCAddSnippet(8, "This chapter describes the Command Center application window and general data tree operations.");
MGCAddSnippet(9, "The Command Center user interface include many of the features found in the Project Manager, such as a data tree, drawing board and property sheets. A major difference is the use of tabbed views to change the window layout and content.");
MGCAddSnippet(10, "The Command Center application window has five views. Each view corresponds to a stage of the workflow.");
MGCAddSnippet(11, "Use this view to select which of the variables of the base project are to be varied, and how they are to be varied.");
MGCAddSnippet(12, "Use this dialog box to define the values of an input variable as a linear function of one or more other numeric input variables.");
MGCAddSnippet(13, "Use this view to select the monitor point variables, derived properties and metric information to store for the parametric study under consideration, and for the cost function, if any, used to evaluate the best design.");
MGCAddSnippet(14, "Use this property sheet to select which object-specific output variable values will be recorded for all scenarios.");
MGCAddSnippet(15, "Use check boxes on this tab to select object data as output variables.");
MGCAddSnippet(16, "Use check boxes on this tab to select output variables of surface temperatures and solid/fluid face temperatures.");
MGCAddSnippet(17, "Use check boxes on this tab to select surface areas of geometric objects as output variables.");
MGCAddSnippet(18, "Use check boxes on this tab to select output variables of conduction, convection, or radiation heat flux. Each is expandable to allow selection for individual X/Y/Z High/Low faces.");
MGCAddSnippet(19, "Use check boxes on this tab to select output variables of volume or mass flow, or pressure drop results.");
MGCAddSnippet(20, "Use check boxes on this tab to select output variables of results of solution variables within the region. Each is expandable to allow selection of Maximum, Minimum, Mean, and Standard Deviation values.");
MGCAddSnippet(21, "Use this table to view the solution status of scenarios. You can also edit input variables values, set the initialization points, choose to store full results for scenarios, and create new scenarios.");
MGCAddSnippet(22, "Use the Scenario Viewer to inspect the parameters and physical layout of each scenario before solving, and to view the results for each scenario after solving.");
MGCAddSnippet(23, "Use this view to track the solution of a selected scenario project or to view residual and monitor point plots after a solution. ");
MGCAddSnippet(24, "Data Tree and Drawing Board operations.");
MGCAddSnippet(25, "Use the Filter option of the Find tool to unclutter the data tree and drawing board.");
MGCAddSnippet(26, "Creation of graphics files.");
MGCAddSnippet(27, "Advanced users can run a FloSCRIPT file from the Command Center.");
MGCAddSnippet(28, "Message window and Find dialog box.");
MGCAddSnippet(29, "This window reports errors, warnings, and information generated by the Command Center.");
MGCAddSnippet(30, "Use this dialog box to perform a quick or detailed search for objects in the current topped assembly in the Command Center or for attributes in the Project Attributes tree.");
MGCAddSnippet(31, "How the Command Center creates different scenarios based on the project loaded in the Project Manager, and the different phases of command optimization.");
MGCAddSnippet(32, "The base project acts as a starting point from which you define how the changes will occur to create different scenario projects.");
MGCAddSnippet(33, "Different scenarios of the base project are created by varying input variables.");
MGCAddSnippet(34, "Use the Output Variables view to select output variables.");
MGCAddSnippet(35, "Use the Scenario Table to monitor and control the scenario projects.");
MGCAddSnippet(36, "Solving scenarios can be monitored using the Solution Monitoring view.");
MGCAddSnippet(37, "A number of automated features are incorporated into the Command Center.");
MGCAddSnippet(38, "How to build scenarios by selecting input variables and defining variations of those variables.");
MGCAddSnippet(39, "You build scenarios parametrically by activating selected variable types (input variables) and defining sequences of values for those variable types.");
MGCAddSnippet(40, "Input variables are activated by selecting them from those available.");
MGCAddSnippet(41, "You can set up numeric input variables with ad-hoc values. ");
MGCAddSnippet(42, "As an alternative to manually defining input variables values, you can set up input variable values as a linear range extending above and/or below the Base Project value. ");
MGCAddSnippet(43, "Only one of the selected variables changes with each scenario created.");
MGCAddSnippet(44, "One scenario is created for each unique combination of input variable values.");
MGCAddSnippet(45, "Superposition of power input variables in scenarios.");
MGCAddSnippet(46, "For numeric input variables, the program must know the upper and lower value bounds.");
MGCAddSnippet(47, "Use when you want a variable to vary according to one or two other variables.");
MGCAddSnippet(48, "To save time spent manually changing sources individually, you can de-rate and pro-rate multiple heat sources using the Assigned Heat Source Rating user variable.");
MGCAddSnippet(49, "You can create a new scenario project by inserting a selected scenario into the next scenario project position.");
MGCAddSnippet(50, "Visual inspection of scenario layouts is recommended before running the solver.");
MGCAddSnippet(51, "Select the output variables to compare results from different scenarios.");
MGCAddSnippet(52, "Output variables are activated by selecting them from those available.");
MGCAddSnippet(53, "A cost function is a weighted sum of a number of output variables which is used to determine the optimum design.");
MGCAddSnippet(54, "The following panels and dialog boxes are used when building and saving scenario projects.");
MGCAddSnippet(55, "Use this dialog box to apply a sweep of input variable values through any existing scenarios.");
MGCAddSnippet(56, "Use this dialog box to set up a sequence of scenario projects that covers every possible combination of selected varying input variables.");
MGCAddSnippet(57, "Use this dialog box to create scenario projects that contain only one variant of a variable at a time.");
MGCAddSnippet(58, "Use this dialog box to create scenarios where power input variables are uniquely given power values.");
MGCAddSnippet(59, "This chapter describes how to change scenario data in the Scenario Table.");
MGCAddSnippet(60, "You can give scenarios more meaningful names than the defaults.");
MGCAddSnippet(61, "In addition to editing input variable values in the Input Variables view, you can also edit these values in the Scenario Table.");
MGCAddSnippet(62, "Values that have been copied to the clipboard can be pasted into the Scenario Table.");
MGCAddSnippet(63, "You can delete individual or multiple-selected input and output variables from scenarios directly from the scenario table.");
MGCAddSnippet(64, "Scenarios can be deleted from the Scenario Table, Scenario Viewer or Solution Monitoring view.");
MGCAddSnippet(65, "You can insert a new scenario project after the currently selected project which is a copy of the selected project.");
MGCAddSnippet(66, "To ensure that a scenario converges quickly it is advisable to initialize the starting conditions from as similar a project as possible. You can initialize the scenarios either as a group or individually.");
MGCAddSnippet(67, "By default only residual and monitor point data are stored for each scenario, however, you can save the full results for display in the GDA. ");
MGCAddSnippet(68, "This file contains definitions of all current scenarios in XML format.");
MGCAddSnippet(69, "The solution of Command Center scenario projects and control of the solvers.");
MGCAddSnippet(70, "A list of possible scenario solution statuses and their descriptions.");
MGCAddSnippet(71, "Use the following procedures when solving scenario projects.");
MGCAddSnippet(72, "You can use solve scenarios in parallel and use multiple processors to solve each scenario.");
MGCAddSnippet(73, "You can solve all scenarios in one operation or solve individual scenarios one at a time.");
MGCAddSnippet(74, "Simple selection of scenarios based on solution results.");
MGCAddSnippet(75, "Residual and monitor point plots displayed in the Solution Monitoring view are synchronized with selections made in the Project Manager.");
MGCAddSnippet(76, "If the project and scenarios have already been set-up in previous Simcenter Flotherm sessions, the solutions can be run in batch mode.");
MGCAddSnippet(77, "A row of Scenario Table data can be more easily compared by creating a chart.");
MGCAddSnippet(78, "Scenario Table cells can be copied and pasted into third-party spreadsheet software, such as Microsoft Excel.");
MGCAddSnippet(79, "You can distribute the solving of scenarios between remote machines on a network.");
MGCAddSnippet(80, "You can use FloVolunteer to manage the project solution across the network.");
MGCAddSnippet(81, "On remote machines running FloVolunteer as a background service, you can use solve scenarios in parallel and use multiple processors to solve each scenario.");
MGCAddSnippet(82, "When configured, remote machines running FloVolunteer will solve scenarios.");
MGCAddSnippet(83, "Use the Scenario Viewer in Analyze mode to view results for each solved scenario.");
MGCAddSnippet(84, "Scenarios can be saved for import into Simcenter Flotherm.");
MGCAddSnippet(85, "Saving the current scenarios so they will be reloaded to the Command Center window when the project is reloaded and the Command Center is opened. It is recommended that you do this regularly to protect your work.");
MGCAddSnippet(86, "You can export all scenarios to a folder where each scenario is captured in a separate PDML file.");
MGCAddSnippet(87, "You can save scenarios as projects, which can be loaded into Simcenter Flotherm independently. Full results and post-processing features, should they exist, are saved with the project.");
MGCAddSnippet(88, "The following dialog boxes are used when running and monitoring the solver.");
MGCAddSnippet(89, "Use this dialog box to control the solution strategy for multiple scenario projects.");
MGCAddSnippet(90, "Use these charts for quick interpretation of the scenario project data. The results and input variables for different scenario projects can be compared on the same chart.");
MGCAddSnippet(91, "Use this dialog box to save the selected scenario project as a new Simcenter Flotherm project.");
MGCAddSnippet(92, "The Command Center uses three design optimization techniques (DoE, SO, and RSO) to provide as much information as possible about the influence of input variables on output variables.");
MGCAddSnippet(93, "The Command Center optimization techniques are used to explore a Design Space, that is, a conceptual space covering a range of values for the design variables.");
MGCAddSnippet(94, "A Design of Experiments (DoE) creates a number of experiments (scenario projects) where the selected input variables are varied within a defined range.");
MGCAddSnippet(95, "Before forming a DoE, you should have a strategy. The following subsections have been written for your guidance.");
MGCAddSnippet(96, "There are two special features that distinguish a designed experiment.");
MGCAddSnippet(97, "Complex computer simulations are often time-consuming. This drives the need for proper designed computer experiments. ");
MGCAddSnippet(98, "A DoE creates scenarios whose input variables are restricted within user-specified ranges.");
MGCAddSnippet(99, "Input constraints can be added to help guide optimization.");
MGCAddSnippet(100, "A Sequential Optimization (SO) uses the results of a DoE as input to create and run further scenarios to find the optimum design. Like a DoE, an SO is performed within a design space defined by input variables and their ranges.");
MGCAddSnippet(101, "A cost function is the value that can be minimized, maximized, or made a specified number by the sequential optimizer.");
MGCAddSnippet(102, "Before running an SO, it is advisable to consider the following aspects.");
MGCAddSnippet(103, "Additional scenario projects are created before selecting the optimum project.");
MGCAddSnippet(104, "Define constraints on output variables so that results that are unacceptable are not flagged optimal.");
MGCAddSnippet(105, "RSO is a faster method of optimization than performing an SO from the best design available.");
MGCAddSnippet(106, "Response Surface Optimization (RSO) fits a response surface to the results of a DoE and recommends the optimum design.");
MGCAddSnippet(107, "Includes post-run operations. You can run an RSO several times to try and improve on the optimum design.");
MGCAddSnippet(108, "The following windows and dialog boxes are used during optimization.");
MGCAddSnippet(109, "Use this dialog box to create a sequence of scenarios using experimental design methods and to define constraints (or limits) on the variable changes.");
MGCAddSnippet(110, "Use this dialog box to set up the sequential optimization controls.");
MGCAddSnippet(111, "Use this viewer to see how input variables affect output variables and the cost function.");
MGCAddSnippet(112, "Use this matrix to visually identify design parameters that correlate well with output variables, including the calibration cost function. The matrix also highlights less relevant design parameters, which you can then exclude from the analysis, thereby saving time.");
MGCAddSnippet(113, "Experimental data acquired from T3Ster can be used to calibrate a Simcenter Flotherm model to a high degree of accuracy.");
MGCAddSnippet(114, "The Command Center can import data from T3Ster Master v2.4 and higher and optimize a Simcenter Flotherm model to produce a simulated structure function that closely matches a T3Ster structure function.");
MGCAddSnippet(115, "The Calibration Error is used as an indicator of how close the Simcenter Flotherm model structure function curves are to those of the experimental model.");
MGCAddSnippet(116, "It is recommended that you limit the calibration extent to the value of ThetaJC, if you, typically, only want to calibrate the package model, not the model of the package and testing environment together.");
MGCAddSnippet(117, "T3Ster Master provides options (modes) for transient correction.");
MGCAddSnippet(118, "Use the Model Calibration dialog box to work through this procedure.");
MGCAddSnippet(119, "You can save Simcenter Flotherm transient data of all scenarios to CSV files for import into T3Ster Master.");
MGCAddSnippet(120, "Use this dialog box to manage the Model Calibration process and to view comparison curves between model and experimental data.");
MGCAddSnippet(121, "Use this dialog box to compare the parameter values of power, transient duration and initial temperature read from the T3Ster calibration file with those defined in the Simcenter Flotherm model, and make adjustments to the Simcenter Flotherm model. ");
MGCAddSnippet(122, "This dialog box shows the progress of loading data for the Model Calibration dialog box plots.");

